    this.loginService
      .authenticate(req.body)
      .then((user) =>
        user
          ? res.json(user)
          : res
              .status(400)
              .json({ message: "Usuário ou senha inválidos" })
              .catch(console.log)
      );
  };
}

module.exports = new LoginController(service);

